construct a SPARQL query that uses Wikidata's property `hasVolume`. The `hasVolume` property encodes the volume of a substance or object, in liters. We can then compare the volumes to determine which object takes up less space.

Here's the SPARQL query:

```
SELECT ?lead ?iron ?lead_vol ?iron_vol WHERE {  
  ?lead wdt:P31 wd:Q70000;  
    wdt:P626+ ?lead_mass.  
  ?lead wdt:P223 ?lead_vol.     
  ?iron wdt:P31 wd:Q61634;
    wdt:P626+ ?iron_mass.  
  ?iron wdt:P223 ?iron_vol. 
  BIND(IRDIF(?lead_mass, ?lead_vol > ?iron_mass, ?lead_mass < ?iron_mass) AS ?result).     
  FILTER(?result)    
}

